import React from 'react';
import '../styles/About.css';  // Import About styles

const About = () => {
    return (
        <section id="about" className="about">
            <h2>About Me</h2>
            <p>I am an IT student passionate about technology and problem-solving. Skilled in programming languages like C, C#, Java, SQL, and MySQL, I enjoy creating efficient solutions to complex challenges. My work experience at Tim Hortons, Circle K, and KD Elite International has strengthened my teamwork, communication, and organizational skills.  
               I am eager to apply my technical knowledge in real-world settings and am currently seeking co-op opportunities in software development and supply chain solutions. With a keen interest in recursion and innovative technologies, I strive to contribute to impactful projects and grow as a professional in the IT industry.</p>
        </section>
    );
}

export default About;
